    title: 'Portfolio',
    image_url: '../../client/images/portfolio.png',
    description: 'alexngo.io',
    name: 'portfolio',
    tag: 'website',
    color: '#000000',
    links: {
        website: '',
        github: 'https://github.com/NgoKnows/my-portfolio',
        npm: ''
    },
    content: {
        idea: 'My Portfolio',
        stack: ['Node.js', 'Koa', 'React.js', 'Redux'],
        execution: [['Server-Side Rendering', 'Besides creating a new place to show my works, I used this as an opportunity to learn how to do server-side rendering with React.\nUp to this point Ive heard all the benefits of server-side rendering, such as load times and allowing web crawlers to index your webpage, to name a few. So I wanted to see how easy (or hard) it would be to do so in React.\nFirst thing I did was try the most simple webpage I could, and that was a plain html page with just a div that said Hello World!. It worked and the concept seemed simple enough, you use React.toString(), and it returns the plain html (with react-ids) of the components which you pass it, you send that html to the client and then once the JavaScript loads, React hooks into your html using the aforementioned react-ids, and then its business as usual!'], ['Adding More Complexity', 'The problems that I ran into came as I started adding more complexity. The first being the styling library I use, which is Radium, a CSS in JS solution. The problem being that the way Radium works is that it applies prefixes based on the user-agent, which is available on the client, but not on the server. Same problem with media-queries, which uses the window measurement on the client, but no such equivalent on the server. The solution being a config that Radium accepts as a prop, which you can pass the user-agent and window size which can be obtained by the request made to the server.\nAnother was React Router, but that was fairly simple, essentially using RouterContext rather than Router on the server-side. There was a bug I ran into with Radium interacting with ReactRouter, which surprisingly turned out to be a bug in React, with the fix hopefully being merged in the next release.\nFinally, the last piece pertaining to server-side rendering, was Redux. The basic way in which this is handled is you compose a store, you can dispatch some actions to change the state, and then you grab the state from the store. From there you take the state and convert it to JSON using JSON.stringify so it is serializable and you can attach it to the html you send in the response. Then on the client side, once the JavaScript loads, Redux grabs the state from the html and everything continues as normal.']]
    }
