    content: {
        idea: 'Visualizing the trajectory of stats of players so that we can compare player\'s careers',
        stack: ['D3', 'React.js', 'Redux', 'Koa'],
        execution: [['Motivation', 'This was an assignment for my data viz class, and I decided to see if I would be able to combine using ReactJS (a front-end library) and d3. Despite knowing this was out of scope, I wanted to see if I could do it, knowing fully well that this may be very challenging and increase both the complexity and time needed. I\u2019ve always been someone who likes to learn as much as possible from assignments when given the opportunity, and would rather spend more time to learn more, than copy and paste for a quick solution.\n\nThe reason I wanted to combine the two was because React along with Redux (a Flux implementation) makes it very easy to keep track and mutate the state of your application. So first thing I did before I did any d3 was set up the data flow for the application, I figured out all of the data I would need to accomplish the visualization I was aiming for.'], ['Getting the data', 'As I mentioned before one of the things that I needed to get data on the names of all past and present NBA players in order to implement autocomplete. I also needed to get their NBA.com ID\u2019s so that I could make the necessary API calls and serving up the correct images. So I luckily was able to find an index page for present and historic players on NBA.com so I had to implement a scraper in Python to parse that page and obtain names and associate those with ID\u2019s. I tossed all of that data into a JSON file.\n'], ['Backend', 'I set up a server in Node, so that I was able to set up an API for my application. One of the things I needed to do was have an efficient way of autocompleting searches, so on the server I essentially used a Trie data structure and inserted all of the names into that and would send search autocomplete results to the application.'], ['D3 + React Events', 'One of the interesting problems I faced while developing this visualization/application. One problem I thought about was how was I going to coordinate interactions with d3 and React, such as hovering over an element such as a \u201CChip\u201D and having that affect the visualization controlled by d3? The solution I came up with was using d3 in the React event handlers, and using Redux in the d3 code so that I could mutate data from within d3 and that mutated data would trickle down into my React components.\n']]
