        npm: ''
    },
    content: {
        idea: 'A place where people who have negative experiences with others in life, can go to and vent about their experiences',
        stack: ['Node.js', 'Koa', 'React.js', 'Redux', 'Socket.io', 'RethinkDB', 'Redis', 'Webpack'],
        execution: [['Server', 'I used Node.js as the backend, and used Koa as the web framework of choice. The reason I chose Koa was because I felt that using generators was a cleaner and more expressive way of handling asynchronous code. It was definitely a challenge at first, getting used to and learning how to use generators, but it made the server-side code very easy to reason about, especially being able to yield to promises and other generators. Something else I appreciate about Koa is that it is a modular framework, allowing you to add features as needed, and avoiding unneeded bloat.\nWriting the REST API was made really easy thanks to the use of Koa. Some new skills I learned were using Redis to cache API responses because the API I was using to implement autocomplete was rate limited, I turned to Redis as a caching solution.'], ['Realtime', 'In addition to this, I used RethinkDB as the data persistence layer, which was a really good choice, both because its query language is very expressive, but also because they implement a feature called change feeds, which allow you to listen to changes on a table, document, or even a query. This makes realtime functionality very easy, so for example you can listen to changes on a table of events, and update your page each time a new event is added.'], ['React/Redux', 'To control dataflow in the application I used Redux, which is an implementation of Facebooks flux architecture. It is heavily influenced by functional programming and revolves around having one state tree for you application, and anytime you want to change the state you dispatch actions which are interpreted by a reducer which determines how your state is changed.\nSo for example in my application, whenever anything happened such as the user moving around the map to explore events or a new event appearing on the map, an action would dispatch and that would update the state, which is then passed to the root of the application. From here the state would flow down to children components and React figures out what needs to be updated, thus updating the view.'], ['Developer Experience', 'For this project I used a lot of technologies that are considered cutting edge, but not because they are so, but rather because I wanted to try out technologies which give the best developer experience. With Koa as I said before uses generators, which I found makes server-side code easy to both write and reason about compared to callbacks and/or promises alone.\nIn addition to this, Redux makes state management so much easier than other solutions I have found. First, Redux touts itself as a Predictable State Container for JavaScript apps, this is because it allows you to be able to manage the state in a manner which you know the sequence of actions that occurred to get to this state. The ecosystem built around Redux is growing quickly, and provides DevTools in which you can see actions as they are being dispatched and even do time-travel, where you can reverse actions that have been dispatched as well as redoing them.\nFinally, something else I very much enjoyed using was Hot Module Reloading which is possible to do with React and Webpack. Essentially whenever you make a change to a component, you can see the change immediately without a refresh, and state remains exactly the same. This is the most amazing part about it, not only do you not have to refresh, but your state remains unchanged, and this means that when you are debugging something that requires you to step through many state changes, it can be cumbersome to have to go through all these steps each time you make a change and have to refresh.'], ['Final Thoughts', 'Overall this project has been really fun to work on, and Ive used it as a way to learn things that Ive always wanted to learn. It may not be the most practical app, but I think Ive learned so much in regards to full stack development, and a variety of technologies. I plan on learning so much more, and this is only the beginning.']]
    }
