        stack: ['AngularJS', 'JavaScript', 'Python', 'D3.js'],
        execution: [['Data Scraping', 'I knew that to implement the features that I wanted to, I would need to get NBA statistics, and at the time there were no free ways of obtaining such information. So I had to scrape the data, and so I implemented a data crawler/scraper in Python. I utilized the BeautifulSoup library to do so, and figured out the general outline of what I would need to do. First I had to access the page which contained all active players of a particular letter, traverse over each letter, and then follow the links leading to each player. Then I analyzed the structure of the page of a players statistics and then was able to extract any relevant statistics. I stored all of this data in a dictionary, and I then wrote that dictionary to a JSON file.'], ['My First Foray into Web Apps', 'This was my first attempt at making a web application, and is what started my journey into web development.']]
