        stack: ['React', 'Webpack', 'NPM'],
        execution: [['Inspiration', 'I was working on Missed Connections for Jerks, and I found that I needed a DatePicker component. Rather than use a pre-made component I decided to build my own, and I had always been interested in how DatePickers were implemented. Most of all, I just wanted to see if I could do it, because it seemed fairly complicated.'], ['NPM', 'Another aspect of this project was uploading my component as an NPM package so that other people can use it. I had to do learn about how uploading NPM packages worked in general, and while that was fairly straightforward, I ran into a few problems with other aspects. The first problem I had was understanding how to include fonts, and images because while I was developing, these were being provided through a CDN and served up through a server respectively. So I eventually figured out that I would need to bundle them with Webpack.\nMy other problem was how to have this code work, when it required transpiration  and not everyone who is going to be using it will be using Babel to transpile. So I came to the solution that I would need to do the transpilation and bundling before uploading to NPM, and this was through running Webpack in the prepublish step which is run before you upload to NPM.\nThere is a link to the npm package above if you want to check it out.']]
